import React from "react";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import CartBtn from "./buttons/CartBtn";
import Login from "./buttons/Login";
import Signup from "./buttons/Signup";
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <Navbar bg="light" expand="lg">
      <Container fluid className="py-2">
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: "100px" }}
            navbarScroll
          >
           <Nav.Link> <Link to="/"></Link>Home</Nav.Link>
           <Nav.Link><Link to="/product"></Link>Product</Nav.Link>
           <Nav.Link><Link to="about"></Link>About</Nav.Link>
           <Nav.Link><Link to="contact"></Link>Contact</Nav.Link>
          </Nav>
          <Navbar.Brand to="#" className="mx-auto fw-bolder">
            E-SHOPPING CART
          </Navbar.Brand>
          <Login />
          <Signup />
          <CartBtn />
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
